Той може да прегрее, когато:
\u0009• извършвате дейности, които изразходват много от батерията, като например гледане на видеоклипове, играене на игри и използване на навигация;
\u0009• изтегляте или качвате големи файлове;
\u0009• е изложен на пряка слънчева светлина."

"Телефонът ви бе твърде горещ, затова се изключи с цел охлаждане. Вече работи нормално.

Телефонът ви може да стане твърде горещ, ако:
\u0009• използвате натоварващи приложения (като например игри или приложения за видео или за навигация);
\u0009• изтегляте или качвате големи файлове;
\u0009• използвате устройството си при високи температури."
